import React from "react";
import "./Banner.css";
import rocketsImage from "../assets/rockets.jpg"; // Add the path to your rockets image

function Banner() {
  return (
    <div className="banner">
      <img src={rocketsImage} alt="Rockets" className="banner-image" />
      <div className="banner-content">
        <h1>Welcome to SpaceX Rockets!</h1>
        <p>Explore the advanced rockets and spacecraft by SpaceX.</p>
      </div>
    </div>
  );
}

export default Banner;
